import React from "react";
import {
  Balance,
  Header,
  IncomeExpense,
  NewTransactionForm,
  TransactionList,
} from "../components";

const Home = () => {
  return (
    <div className="container">
      <Header />
      <Balance />
      <IncomeExpense />
      <TransactionList />
      <NewTransactionForm />
    </div>
  );
};

export default Home;
